function init_filters(){let t=document.forms.filters,e=window.location.search.split("?");if(e.length>1){e=(e=(e=(e=decodeURI(e[1])).replace(/\+/g," ")).replace(/\[\d+\]/g,"[]")).split("&");for(let i=0;i<e.length;i++){let l=e[i].split("=");for(let e=0;e<t[l[0]].length;e++)t[l[0]][e].value==l[1]&&t[l[0]][e].setAttribute("checked","")}}}function submitform(){document.forms.filters.submit()}init_filters();